import collections
import datetime


class Solution:

    # 思路是对的， 但是会超时 时间复杂度太高
    def uniqueLetterString2(self, s: str) -> int:
        n = len(s)
        pre = [-1] * n
        buc = dict()
        for i, c in enumerate(s):
            if c in buc:
                pre[i] = buc[c]
            buc[c] = i
        dp = [[0 for _ in range(n)] for _ in range(n)]
        res = 0
        for i in range(n):
            dp[i][i] = 1
            count = 1
            a = pre[i]
            b = pre[a] if a != -1 else -1
            for j in range(i - 1, a, -1):
                dp[j][i] = dp[j][i - 1] + 1
                count += dp[j][i]
            for j in range(a, b, -1):
                dp[j][i] = dp[j][i - 1] - 1
                count += dp[j][i]
            for j in range(b, -1, -1):
                dp[j][i] = dp[j][i - 1]
                count += dp[j][i]
            res += count
        return res

    def uniqueLetterString(self, s: str) -> int:
        n = len(s)
        ls = [-1] * n
        buc = dict()
        for i, c in enumerate(s):
            if c in buc:
                ls[i] = buc[c]
            buc[c] = i
        rs = [n] * n
        buc = dict()
        for i in range(n - 1, - 1, - 1):
            c = s[i]
            if c in buc:
                rs[i] = buc[c]
            buc[c] = i

        res = 0
        for i in range(n):
            l, r = ls[i], rs[i]
            res += (i - l) * (r - i)
        return res


if __name__ == '__main__':
    s = Solution()
    print(s.uniqueLetterString(s="LEETCODE"))
    print(s.uniqueLetterString(s="ABA"))
    print(s.uniqueLetterString(s="ABC"))

    print(s.uniqueLetterString(
        ""))

